import styled from "styled-components"


export const Container = styled.div`
    max-width: 1120px;
    margin: 0 auto;
    margin-bottom: 50px;
`;

export const Content = styled.div`
    margin-top: 50px;
    justify-content: center;
    iframe{
        width: 560px;
        height: 315px;
    }
`;
